import React from "react";

const AdminViewOrders = () => {
    return (
        <>
            <div className="container-fluid ">
                <div className="row">
                    <div className="col-2">Name:</div>
                    <div className="col-2">Total Amount:</div>
                </div>
                <div className="row">
                    <div className="col-3">
                        FoodName
                    </div>
                    <div className="col-3">
                        FoodPrice
                    </div>
                </div>

            </div>
        </>
    );
};

export default AdminViewOrders;
